import React, { useState } from "react";
import Sidebar from "../Candidates/Sidebar";
import msg from '../../Assets/MailIcon.png'
import notification from '../../Assets/notifications.png'
import downIcon from "../../Assets/DownIcon.png"
import ellipse from "../../Assets/ellipse.png"
import "./Leaves.css"

const leaves = [
  {
    id: 1,
    name: "Jacob William",
    date: "8/09/2024",
    reason:"Visiting House",
    status: "Approved",
    docs: "file"
  }
];

const Leaves=()=>{
  const[sidebarOpen , setSidebarOpen]=useState(false);

  return (
    <div className="dashboard">
      <Sidebar/>
      <div className="main">

        <div className="header">
          <h2>Leaves</h2>
          <div>
            <img src={msg}/>
            <img src={notification}/>
            <img src={ellipse}/>
            <img src={downIcon}/>
          </div>
        </div>

        <div className="filters">
          <div>
            <select>
              <option>Status</option>
            </select>
          </div>

          <div className="header-actions">
            <input type="text" placeholder="Search" />
            <button className="add-candidate">Add Leave</button>
          </div>

        </div>

        <div className="table-wrapper">
          <table>
            <thead>
              <tr>Applied Leaves</tr>
              <tr>
                <th>
                  <h4>Applied Leaves</h4>
                  <th>Profile</th>
                </th>
                <th>Name</th>
                <th>Date</th>
                <th>Reason</th>
                <th>Status</th>
                <th>Docs</th>
              </tr>
            </thead>
            <tbody>
            {leaves.map((l, i) => (
                <tr key={l.id}>
                  <td>{`0${i + 1}`}</td>
                  <td>{l.name}</td>
                  <td>{l.date}</td>
                  <td>{l.reason}</td>
                  <td>
                    <button className={`status ${l.status}`}>
                      {l.status.charAt(0).toUpperCase() + l.status.slice(1)}
                    </button>
                  </td>
                  <td>{l.docs}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default Leaves;


